import React, { Component } from 'react';
import { Container } from 'semantic-ui-react';
import showTender from '../components/DonationLogs/showTender';

export default class Donation extends Component {
  render() {
    return (
    <div>
      <Container textAlign='center'>DONATION PAGE</Container>
      <showTender />
       </div>
    );
  }
}
